import { Box, Button, InputAdornment, TextField, styled } from "@mui/material";
import "./Cart.css";

const ColorButton = styled(Button)(({ theme }) => ({
  color: theme.palette.getContrastText(purple[500]),
  // @ts-ignore
  backgroundColor: theme.palette.ali.main,
  "&:hover": {
    // @ts-ignore
    backgroundColor: theme.palette.ali.main,
    scale: "0.99"
  },
}));

const Cart = () => {
  // Why <<<component="form">>> ?
